import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="tableBox"> 
        <table>
          <tr>
            <th>테이블 연습</th>
          </tr>
          <tr>
            <td></td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default App;
